v allokeret.\\nDa Amie fylder 20 år er hun nu færdig med sin allokering og en del er sket på de bare 2 år.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1logseq____&gt;logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Flogseq____&quot;,856,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Xlogseq____&quot;,175,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Vlogseq____&quot;,175,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Ulogseq____&quot;,175,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Ulogseq____&quot;,176,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Ulogseq____&quot;,321,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Clogseq____&quot;,3],536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Jlogseq____&quot;,[],536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Hlogseq____&quot;,176,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^Hlogseq____&quot;,321,536870967]],[logseq____&quot;^15logseq____&quot;,[864,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66182655-fae5-4b44-8ba5-0a94e759e253logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[865,logseq____  chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1logseq____&gt;logseq____&quot;,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Flogseq____&quot;,1106,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Xlogseq____&quot;,21,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Vlogseq____&quot;,21,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Ulogseq____&quot;,21,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Clogseq____&quot;,3],536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Jlogseq____&quot;,[],536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^Hlogseq____&quot;,21,536871004]],[logseq____&quot;^15logseq____&quot;,[1099,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66182655-ef0e-422d-a170-5d59d7ea35f6logseq____&quot;,536871004]],[logseq____&quot;^15logseq____&quot;,[1100,logseq____&quot;^Qlogseq_       // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
